package com.xzh.bean;

public class MenuInfo {
	private int mi_id;
	private String mi_name;
	private int mi_menuLevel;
	
	public MenuInfo() {
		super();
		// TODO Auto-generated constructor stub
	}
	public int getMi_id() {
		return mi_id;
	}
	public void setMi_id(int mi_id) {
		this.mi_id = mi_id;
	}
	public String getMi_name() {
		return mi_name;
	}
	public void setMi_name(String mi_name) {
		this.mi_name = mi_name;
	}
	public int getMi_menuLevel() {
		return mi_menuLevel;
	}
	public void setMi_menuLevel(int mi_menuLevel) {
		this.mi_menuLevel = mi_menuLevel;
	}
}
